import React, {useState, useEffect} from 'react';

export default function CarList (props){

  return(
    <ul>
      {props.carList.map(c => <li key={c.id}>
        <p>
          ID {c.id} | REGNR {c.regNr} : Vin NR {c.vehicleNr} : REGNR {c.regNr}
        </p>
          
          
        </li>)}
    </ul>
  )
}
